Crux uses Mozilla's Uniffi to generate the FFI bindings for iOS and Android. Generating the uniffi-bindgen CLI tool Since version 0.23.0 of Uniffi, we need to also generate the binary that generates these bindings. This avoids the possibility of getting a version mismatch between a separately installed binary and the crate's Uniffi version. You can read more about it here . Generating the binary is simple, we just add the following to our crate, in a file called /shared/src/bin/uniffi-bindgen.rs. fn main() { uniffi::uniffi_bindgen_main()
} And then we can build it with cargo. cargo run -p shared --bin uniffi-bindgen # or cargo build
./target/debug/uniffi-bindgen The uniffi-bindgen executable will be used during the build in XCode and in Android Studio (see the following pages). The interface definitions We will need an interface definition file for the FFI bindings. Uniffi has its own file format (similar to WebIDL) that has a .udl extension. You can create one at /shared/src/shared.udl, like this: namespace shared { bytes process_event([ByRef] bytes msg); bytes handle_response(u32 id, [ByRef] bytes res); bytes view();
}; There are also a few additional parameters to tell Uniffi how to create bindings for Kotlin and Swift. They live in the file /shared/uniffi.toml, like this (feel free to adjust accordingly): [bindings.kotlin]
package_name = "com.example.simple_counter.shared"
cdylib_name = "shared" [bindings.swift]
cdylib_name = "shared_ffi"
omit_argument_labels = true Finally, we need a build.rs file in the root of the crate (/shared/build.rs), to generate the bindings: fn main() { uniffi::generate_scaffolding("./src/shared.udl").unwrap();
}

