We want the shell to be as thin as possible, so we need to write as little platform-specific code as we can because this work has to be duplicated for each platform. In general, the more domain-aligned our capabilities are, the more code we'll write. When our capabilities are generic, and closer to the technical end of the spectrum, we get to write the least amount of shell code to support them. Getting the balance right can be tricky, and the right answer might be different depending on context. Obviously the Http capability is very generic, but a CMS capability, for instance, might well be much more specific. The shell-side code for the Http capability can be very small. A (very) naive implementation for Android might look like this: package com.example.counter import com.example.counter.shared_types.HttpHeader
import com.example.counter.shared_types.HttpRequest
import com.example.counter.shared_types.HttpResponse
import com.novi.serde.Bytes
import io.ktor.client.HttpClient
import io.ktor.client.call.body
import io.ktor.client.request.headers
import io.ktor.client.request.request
import io.ktor.http.HttpMethod
import io.ktor.util.flattenEntries suspend fun requestHttp( client: HttpClient, request: HttpRequest,
): HttpResponse { val response = client.request(request.url) { this.method = HttpMethod(request.method) this.headers { for (header in request.headers) { append(header.name, header.value) } } } val bytes = Bytes.valueOf(response.body()) val headers = response.headers.flattenEntries().map { HttpHeader(it.first, it.second) } return HttpResponse(response.status.value.toShort(), headers, bytes)
} The shell-side code to support a capability (or "Port" in "Ports and Adapters"), is effectively just an "Adapter" (in the same terminology) to the native APIs. Note that it's the shell's responsibility to cater for threading and/or async coroutine requirements (so the above Kotlin function is suspend for this reason). The above function can then be called by the shell when an effect is emitted requesting an HTTP call. It can then post the response back to the core (along with the id that is used by the core to tie the response up to its original request): for (req in requests) when (val effect = req.effect) { is Effect.Http -> { val response = requestHttp(httpClient, effect.value) val effects = handleResponse( request.id.toUInt(), HttpResult.Ok(response).bincodeSerialize() ) val requests = Requests.bincodeDeserialize(effects) for (request in requests) { processEffect(request) } } // ...
}

