The first step for anything to happen is spawning a task from a capability. Each capability is created with a CapabilityContext. This is the definition: pub struct CapabilityContext<Op, Event>
where Op: Operation,
{ inner: std::sync::Arc<ContextInner<Op, Event>>,
} struct ContextInner<Op, Event>
where Op: Operation,
{ shell_channel: Sender<Request<Op>>, app_channel: Sender<Event>, spawner: executor::Spawner,
} There are a couple of sending ends of channels for requests and events, which we will get to soon, and also a spawner, from the executor module. The Spawner looks like this: #[derive(Clone)]
pub struct Spawner { future_sender: Sender<BoxFuture>,
} also holding a sending end of a channel, this one for Tasks. Tasks are a fairly simple data structure, holding a future and another sending end of the tasks channel, because tasks need to be able to submit themselves when awoken. Tasks are spawned by the Spawner as follows: impl Spawner { pub fn spawn(&self, future: impl Future<Output = ()> + 'static + Send) { let future = future.boxed(); self.future_sender .send(future) .expect("unable to spawn an async task, task sender channel is disconnected.") }
} after constructing a task, it is submitted using the task sender. The final piece of the puzzle is the executor itself: pub(crate) struct QueuingExecutor { spawn_queue: Receiver<BoxFuture>, ready_queue: Receiver<TaskId>, ready_sender: Sender<TaskId>, tasks: Mutex<Slab<Option<BoxFuture>>>,
} This is the receiving end of the channel from the spawner. The executor has a single public method, run_all: impl QueuingExecutor { pub fn run_all(&self) { // we read off both queues and execute the tasks we receive. // Since either queue can generate work for the other queue, // we read from them in a loop until we are sure both queues // are exhausted let mut did_some_work = true; while did_some_work { did_some_work = false; while let Ok(task) = self.spawn_queue.try_recv() { let task_id = self .tasks .lock() .expect("Task slab poisoned") .insert(Some(task)); self.run_task(TaskId(task_id.try_into().expect("TaskId overflow"))); did_some_work = true; } while let Ok(task_id) = self.ready_queue.try_recv() { match self.run_task(task_id) { RunTask::Unavailable => { // We were unable to run the task as it is (presumably) being run on // another thread. We re-queue the task for 'later' and do NOT set // `did_some_work = true`. That way we will keep looping and doing work // until all remaining work is 'unavailable', at which point we will bail // out of the loop, leaving the queued work to be finished by another thread. // This strategy should avoid dropping work or busy-looping self.ready_sender.send(task_id).expect("could not requeue"); } RunTask::Missing => { // This is possible if a naughty future sends a wake notification while // still running, then runs to completion and is evicted from the slab. // Nothing to be done. } RunTask::Suspended | RunTask::Completed => did_some_work = true, } } } } fn run_task(&self, task_id: TaskId) -> RunTask { let mut lock = self.tasks.lock().expect("Task slab poisoned"); let Some(task) = lock.get_mut(*task_id as usize) else { return RunTask::Missing; }; let Some(mut task) = task.take() else { // the slot exists but the task is missing - presumably it // is being executed on another thread return RunTask::Unavailable; }; // free the mutex so other threads can make progress drop(lock); let waker = Arc::new(TaskWaker { task_id, sender: self.ready_sender.clone(), }) .into(); let context = &mut Context::from_waker(&waker); // poll the task if task.as_mut().poll(context).is_pending() { // If it's still pending, put the future back in the slot self.tasks .lock() .expect("Task slab poisoned") .get_mut(*task_id as usize) .expect("Task slot is missing") .replace(task); RunTask::Suspended } else { // otherwise the future is completed and we can free the slot self.tasks.lock().unwrap().remove(*task_id as usize); RunTask::Completed } }
} enum RunTask { Missing, Unavailable, Suspended, Completed,
} besides the locking and waker mechanics, the gist is quite simple - while there are tasks in the ready_queue, poll the future held in each one. The last interesting bit of this part is how the waker is provided to the poll call. The waker_ref creates a waker which, when asked to wake up, will call this method on the task: impl Wake for TaskWaker { fn wake(self: Arc<Self>) { self.wake_by_ref(); } fn wake_by_ref(self: &Arc<Self>) { // This send can fail if the executor has been dropped. // In which case, nothing to do let _ = self.sender.send(self.task_id); }
} this is where the task resubmits itself for processing on the next run. While there are a lot of moving pieces involved, the basic mechanics are relatively straightforward - tasks are submitted either by the spawner, or the futures awoken by arriving responses to the requests they submitted. The queue of tasks is processed whenever run_all is called on the executor. This happens in the Core API implementation. Both process_event and resolve call run_all after their respective task - calling the app's update function, or resolving the given task. Now we know how the futures get executed, suspended and resumed, we can examine the flow of information between capabilities and the Core API calls layered on top.

