We've now seen everything other than the mechanics of resolving requests. This is ultimately just a callback carried by the request, but for additional type safety, it is tagged by the expected number of resolutions type ResolveOnce<Out> = Box<dyn FnOnce(Out) + Send>;
type ResolveMany<Out> = Box<dyn Fn(Out) -> Result<(), ()> + Send>; /// Resolve is a callback used to resolve an effect request and continue
/// one of the capability Tasks running on the executor.
pub(crate) enum Resolve<Out> { Never, Once(ResolveOnce<Out>), Many(ResolveMany<Out>),
} We've already mentioned the resolve function itself briefly, but for completeness, here's an example from request_from_shell: let request = Request::resolves_once(operation, move |result| { let Some(shared_state) = callback_shared_state.upgrade() else { // The ShellRequest was dropped before we were called, so just // do nothing. return; }; let mut shared_state = shared_state.lock().unwrap(); // Attach the result to the shared state of the future shared_state.result = Some(result); // Signal the executor to wake the task holding this future if let Some(waker) = shared_state.waker.take() { waker.wake() } }); Bar the locking and sharing mechanics, all it does is update the state of the future (shared_state) and then calls wake on the future's waker to schedule it on the executor. In the next chapter, we will look at how this process changes when Crux is used via an FFI interface where requests and responses need to be serialised in order to pass across the language boundary.

