It is worth pausing for a second on the resolve registry. There is one tricky problem to solve here - storing the generic Requests in a single store. We get around this by making the register method generic and asking the effect to "serialize" itself. pub fn register<Eff>(&self, effect: Eff) -> Request<Eff::Ffi> where Eff: Effect, { let (effect, resolve) = effect.serialize(); let id = self .0 .lock() .expect("Registry Mutex poisoned.") .insert(resolve); Request { id: EffectId(id.try_into().expect("EffectId overflow")), effect, } } this is named based on our intent, not really based on what actually happens. The method comes from an Effect trait: pub trait Effect: Send + 'static { /// Ffi is an enum with variants corresponding to the Effect variants /// but instead of carrying a `Request<Op>` they carry the `Op` directly type Ffi: Serialize; /// Converts the `Effect` into its FFI counterpart and returns it alongside /// a deserializing version of the resolve callback for the request that the /// original `Effect` was carrying. /// /// You should not need to call this method directly. It is called by /// the [`Bridge`](crate::bridge::Bridge) fn serialize(self) -> (Self::Ffi, ResolveSerialized);
} Like the Effect type which implements this trait, the implementation is macro generated, based on the Capabilities used by your application. We will look at how this works in the Effect type chapter. The type signature of the method gives us a hint though - it converts the normal Effect into a serializable counterpart, alongside something with a ResolveSerialized type. This is stored in the registry under an id, and the effect and the id are returned as the bridge version of a Request. The definition of the ResolveSerialized type is a little bit convoluted: type ResolveOnceSerialized = Box<dyn FnOnce(&mut dyn erased_serde::Deserializer) + Send>;
type ResolveManySerialized = Box<dyn FnMut(&mut dyn erased_serde::Deserializer) -> Result<(), ()> + Send>; /// A deserializing version of Resolve
///
/// ResolveSerialized is a separate type because lifetime elision doesn't work
/// through generic type arguments. We can't create a ResolveRegistry of
/// Resolve<&[u8]> without specifying an explicit lifetime.
/// If you see a better way around this, please open a PR.
pub enum ResolveSerialized { Never, Once(ResolveOnceSerialized), Many(ResolveManySerialized),
} but the gist of it is that it is a mirror of the Resolve type we already know, except it takes a Deserializer. More about this serialization trickery in the next chapter.

