}; This is UniFFI's interface definition used to generate the scaffolding for the FFI interface - both the externally callable functions in the shared library, and their counterparts in the "foreign" languages (like Swift or Kotlin). The scaffolding is built in the build.rs script of the crate fn main() { uniffi::generate_scaffolding("./src/shared.udl").unwrap();
