A simple app that increments, decrements and resets a counter. Wrap the core to support capabilities First, let's add some boilerplate code to wrap our core and handle the capabilities that we are using. For this example, we only need to support the Render capability, which triggers a render of the UI. Note This code that wraps the core only needs to be written once — it only grows when we need to support additional capabilities. Edit iOS/SimpleCounter/core.swift to look like the following. This code sends our (UI-generated) events to the core, and handles any effects that the core asks for. In this simple example, we aren't calling any HTTP APIs or handling any side effects other than rendering the UI, so we just handle this render effect by updating the published view model from the core. import Foundation
import SharedTypes @MainActor
class Core: ObservableObject { @Published var view: ViewModel init() { self.view = try! .bincodeDeserialize(input: [UInt8](SimpleCounter.view())) } func update(_ event: Event) { let effects = [UInt8](processEvent(Data(try! event.bincodeSerialize()))) let requests: [Request] = try! .bincodeDeserialize(input: effects) for request in requests { processEffect(request) } } func processEffect(_ request: Request) { switch request.effect { case .render: view = try! .bincodeDeserialize(input: [UInt8](SimpleCounter.view())) } }
} Tip That switch statement, above, is where you would handle any other effects that your core might ask for. For example, if your core needs to make an HTTP request, you would handle that here. To see an example of this, take a look at the counter example in the Crux repository. Edit iOS/SimpleCounter/ContentView.swift to look like the following: import SharedTypes
import SwiftUI struct ContentView: View { @ObservedObject var core: Core var body: some View { VStack { Image(systemName: "globe") .imageScale(.large) .foregroundColor(.accentColor) Text(core.view.count) HStack { ActionButton(label: "Reset", color: .red) { core.update(.reset) } ActionButton(label: "Inc", color: .green) { core.update(.increment) } ActionButton(label: "Dec", color: .yellow) { core.update(.decrement) } } } }
} struct ActionButton: View { var label: String var color: Color var action: () -> Void init(label: String, color: Color, action: @escaping () -> Void) { self.label = label self.color = color self.action = action } var body: some View { Button(action: action) { Text(label) .fontWeight(.bold) .font(.body) .padding(EdgeInsets(top: 10, leading: 15, bottom: 10, trailing: 15)) .background(color) .cornerRadius(10) .foregroundColor(.white) .padding() } }
} struct ContentView_Previews: PreviewProvider { static var previews: some View { ContentView(core: Core()) }
} And create iOS/SimpleCounter/SimpleCounterApp.swift to look like this: import SwiftUI @main
struct SimpleCounterApp: App { var body: some Scene { WindowGroup { ContentView(core: Core()) } }
} Run xcodegen again to update the Xcode project with these newly created source files (or add them manually in Xcode to the SimpleCounter group), and then open iOS/SimpleCounter/SimpleCounter.xcodeproj in Xcode. You might need to select the SimpleCounter scheme, and an appropriate simulator, in the drop-down at the top, before you build. Success You should then be able to run the app in the simulator or on an iPhone, and it should look like this:

