Before we dive into the thinking behind the architecture, let's add one more feature - a remote API call - to get a better feel for how side-effects and capabilities work. Example You can find the full code for this part of the guide here We'll add a simple integration with a counter API we've prepared at https://crux-counter.fly.dev . All it does is count up an down like our local counter. It supports three requests GET / returns the current count POST /inc increments the counter POST /dec decrements the counter All three API calls return the state of the counter in JSON, which looks something like this { "value": 34, "updated_at": 1673265904973
} We can represent that with a struct, and we'll need to update the model as well. We can use Serde for the serialization (deserializing updated_at from timestamp milliseconds to an option of DateTime using chrono). We'll also update the count optimistically by keeping track of if/when the server confirmed it (there are other ways to model these semantics, but let's keep it straightforward for now). use chrono::{DateTime, Utc};
use chrono::serde::ts_milliseconds_option::deserialize as ts_milliseconds_option; #[derive(Default, Serialize)]
pub struct Model { count: Count,
} #[derive(Serialize, Deserialize, Clone, Default, Debug, PartialEq, Eq)]
pub struct Count { value: isize, #[serde(deserialize_with = "ts_milliseconds_option")] updated_at: Option<DateTime<Utc>>,
} We also need to update the ViewModel and the view() function to display the new data. #[derive(Serialize, Deserialize, Debug, Clone)]
pub struct ViewModel { pub text: String, pub confirmed: bool,
} ... fn view(&self, model: &Self::Model) -> Self::ViewModel { let suffix = match model.count.updated_at { None => " (pending)".to_string(), Some(d) => format!(" ({d})"), }; Self::ViewModel { text: model.count.value.to_string() + &suffix, confirmed: model.count.updated_at.is_some(), }
} You can see that the view function caters to two states - the count has not yet been confirmed (updated_at is None), and having the count confirmed by the server. In a real-world app, it's likely that this information would be captured in a struct rather than converted to string inside the core, so that the UI can decide how to present it. The date formatting, however, is an example of something you may want to do consistently across all platforms and keep inside the Core. When making these choices, think about whose decisions they are, and do they need to be consistent across platforms or flexible. You will no doubt get a number of those calls wrong, but that's ok, the type system is here to help you refactor later and update the shells to work with the changes. We now have everything in place to update the update function. Let's start with thinking about the events. The API does not support resetting the counter, so that variant goes, but we need a new one to kick off fetching the current state of the counter. The Core itself can't autonomously start anything, it is always driven by the Shell, either by the user via the UI, or as a result of a side-effect. That gives us the following update function, with some placeholders: fn update(&self, event: Self::Event, model: &mut Self::Model, caps: &Self::Capabilities) { match event { Event::Get => { // TODO "GET /" } Event::Set(_response) => { // TODO Get the data and update the model caps.render.render(); } Event::Increment => { // optimistic update model.count.value += 1; model.count.updated_at = None; caps.render.render(); // real update // TODO "POST /inc" } Event::Decrement => { // optimistic update model.count.value -= 1; model.count.updated_at = None; caps.render.render(); // real update // TODO "POST /dec" } }
} To request the respective HTTP calls, we'll use crux_http the built-in HTTP client. Since this is the first capability we're using, some things won't be immediately clear, but we should get there by the end of this chapter. The first thing to know is that the HTTP responses will be sent back to the update function as an event. That's what the Event::Set is for. The Event type looks as follows: #[derive(Serialize, Deserialize, Debug, PartialEq, Eq)]
pub enum Event { // these variants are used by the Shell Get, Increment, Decrement, // this variant is private to the Core #[serde(skip)] Set(crux_http::Result<crux_http::Response<Count>>),
} We decorate the Set variant with #[serde(skip)] for two reasons: one, there's currently a technical limitation stopping us easily serializing crux_http::Response, and two, there's no reason that variant should ever be sent by the Shell across the FFI boundary, which is the reason for the need to serialize in the first place — in a way, it is private to the Core. Finally, let's get rid of those TODOs. We'll need to add crux_http in the Capabilities type, so that the update function has access to it: use crux_http::Http; #[derive(Effect)]
pub struct Capabilities { pub http: Http<Event>, pub render: Render<Event>,
} This may seem like needless boilerplate, but it allows us to only use the capabilities we need and, more importantly, allow capabilities to be built by anyone. Later on, we'll also see that Crux apps compose , relying on each app's Capabilities type to declare its needs, and making sure the necessary capabilities exist in the parent app. We can now implement those TODOs, so lets do it. const API_URL: &str = "https://crux-counter.fly.dev"; //... fn update(&self, event: Self::Event, model: &mut Self::Model, caps: &Self::Capabilities) { match event { Event::Get => { caps.http.get(API_URL).expect_json().send(Event::Set); } Event::Set(Ok(mut response)) => { let count = response.take_body().unwrap(); model.count = count; caps.render.render(); } Event::Set(Err(_)) => { panic!("Oh no something went wrong"); } Event::Increment => { // optimistic update model.count = Count { value: model.count.value + 1, updated_at: None, }; caps.render.render(); // real update let base = Url::parse(API_URL).unwrap(); let url = base.join("/inc").unwrap(); caps.http.post(url).expect_json().send(Event::Set); } Event::Decrement => { // optimistic update model.count = Count { value: model.count.value - 1, updated_at: None, }; caps.render.render(); // real update let base = Url::parse(API_URL).unwrap(); let url = base.join("/dec").unwrap(); caps.http.post(url).expect_json().send(Event::Set); } } } There's a few things of note. The first one is that the .send API at the end of each chain of calls to crux_http expects a function that wraps its argument (a Result of a http response) in a variant of Event. Fortunately, enum tuple variants create just such a function, and we can use it. The way to read the call is "Send a get request, parse the response as JSON, which should be deserialized as a Count, and then call me again with Event::Set carrying the result". Interestingly, we didn't need to specifically mention the Count type, as the type inference from the Event::Set variant is enough, making it