Set` event (containing the HTTP response) to the app let update = app.update( Event::Set(Ok(ResponseBuilder::ok() .body(Count { value: 1, updated_at: Some(Utc.with_ymd_and_hms(2023, 1, 1, 0, 0, 0).unwrap()), }) .build())), &mut model, ); // check that the app asked the shell to render assert_effect!(update, Effect::Render(_)); // check that the view has been updated correctly insta::assert_yaml_snapshot!(app.view(&model), @r###" --- text: "1 (2023-01-01 00:00:00 UTC)" confirmed: true "###); } Incidentally, we're using insta in that last test to assert that the view model is correct. If you don't know it already, check it out. The really cool thing is that if the test fails, it shows you a diff of the actual and expected output, and if you're happy with the new output, you can accept the change (or not) by running cargo insta review — it will update the code for you to reflect the change. It's a really nice way to do snapshot testing, especially for the model and view model. You can see how easy it is to check that the app is requesting the right side effects, with the right arguments, and even test a chain of interactions and make sure the behavior is correct, all without mocking or stubbing anything or worrying about async code. In the next chapter, we can put the example into perspective and discuss the architecture it follows, inspired by Elm.

