In more complex apps, you might run into situations where you need to run several effects in parallel, race them, run them in sequence or a combination of the above. In other words, in some scenarios, you really need the full control of async/await and the futures APIs. To support this case, Crux provides a built-in capability called Compose, which provides restricted but direct access to the capability runtime (more about the runtime in the next chapter), which supports async. To use it, first add it to your Capabilities struct: use crux::compose::Compose; #[derive(crux_core::macros::Effect)]
pub struct Capabilities { pub http: Http<Event>, pub render: Render<Event>, #[effect(skip)] // skips the compose variant when deriving an Effect enum pub compose: Compose<Event>,
} Then, you can use it in your update function like this: fn update(&self, msg: Event, model: &mut Model, caps: &Capabilities) { match msg { Event::GetDocuments => caps.compose.spawn(|context| { let http = caps.http.clone(); async move { let ids = http .get(DOCS_URL) .await .expect("Request should send") .body_json::<Vec<Id>>() .await .expect("Ids failed to parse as JSON"); let futs: Vec<_> = ids .iter() .map(|id| { let http = http.clone(); async move { http.get(&format!("{}/{}", DOCS_URL, id)) .await .expect("request did not send") .body_json::<Doc>() .await .expect("doc failed to parse as JSON") } }) .collect(); let docs = futures::future::join_all(futs).await; context.update_app(Event::FetchedDocuments(docs)) } }), // ... }
} The above code first fetches a list of document IDs, then fetches each document in parallel, and finally returns the list of documents as an event. The spawn method takes a closure which is passed a ComposeContext argument. This is a handle to the capability runtime, which allows you to send events back to the app. The closure must return a future, which is then spawned on the runtime. The runtime will drive the future to completion. You can call context.update_app multiple times if necessary. One consideration of this style of orchestration is that the more effects you string together this way, the harder it will be to test the behaviour of this ad-hoc capability, because you can't start the transaction in the middle. Generally, if you find yourself sending events using update_app and then continuing to emit more effects, you should probably break the orchestration up into smaller blocks executed in response to the events in the update function instead. Now that we know how to use capabilities, we're ready to look at building our own ones. You may never need to do that, or it might be one of the first hurdles you'll come across (and if we're honest, given how young Crux is, it's more likely the latter). Either way, it's what we'll do in the next chapter.

