The first job of our capability will be to pause for a given number of milliseconds and then send an event to the app. There's a number of types and traits we will need to implement to make the capability work with the rest of Crux, so let's quickly go over them before we start. We will need The capability itself, able to hold on to the context used to interact with Crux The payload type for the effect, holding the number of milliseconds requested Implementation of the Capability trait Let's start with the payload: #[derive(Serialize, Deserialize, Clone, Debug, PartialEq, Eq)]
pub struct DelayOperation { millis: usize
} The request is just a named type holding onto a number. It will need to cross the FFI boundary, which is why it needs to be serializable, cloneable, etc. We will need our request to implement the Operation trait, which links it with the type of the response we expect back. In our case we expect a response, but there is no data, so we'll use the unit type. use crux_core::capability::Operation; impl Operation for DelayOperation { type Output = ();
} Now we can implement the capability: use crux_core::capability::CapabilityContext;
use crux_core::macros::Capability; #[derive(Capability)]
struct Delay<Ev> { context: CapabilityContext<DelayOperation, Ev>,
} impl<Ev> Delay<Ev>
where Ev: 'static,
{ pub fn new(context: CapabilityContext<DelayOperation, Ev>) -> Self { Self { context } } pub fn milliseconds(&self, millis: usize, event: Ev) where Ev: Send, { let ctx = self.context.clone(); self.context.spawn(async move { ctx.request_from_shell(DelayOperation { millis }).await; ctx.update_app(event); }); }
} There's a fair bit going on. The capability is generic over an event type Ev and holds on to a CapabilityContext. The constructor will be called by Crux when starting an application that uses this capability. The milliseconds method is our capability's public API. It takes the delay in milliseconds and the event to send back. In this case, we don't expect any payload to return, so we take the Ev type directly. We'll shortly see what an event with data looks like as well. The implementation of the method has a little bit of boilerplate to enable us to use async code. First we clone the context to be able to use it in the async block. Then we use the context to spawn an async move code block in which we'll be able to use async/await. This bit of code will be the same in every part of your capability that needs to interact with the Shell. You can see we use two APIs to orchestrate the interaction. First request_from_shell sends the delay operation we made earlier to the Shell. This call returns a future, which we can .await. Once done, we use the other API update_app to dispatch the event we were given. At the .await, the task will be suspended, Crux will pass the operation to the Shell wrapped in the Effect type we talked about in the last chapter and the Shell will use its native APIs to wait for the given duration, and eventually respond. This will wake our task up again and we can continue working. Finally, we need to implement the Capability trait. This is done for us by the #[derive(Capability)] macro, but it is worth looking at the generated code: impl<Ev> Capability<Ev> for Delay<Ev> { type Operation = DelayOperation; type MappedSelf<MappedEv> = Delay<MappedEv>; fn map_event<F, NewEv>(&self, f: F) -> Self::MappedSelf<NewEv> where F: Fn(NewEv) -> Ev + Send + Sync + Copy + 'static, Ev: 'static, NewEv: 'static, { Delay::new(self.context.map_event(f)) }
} What on earth is that for, you ask? This allows you to derive an instance of the Delay capability from an existing one and adapt it to a different Event type. Yes, we know, don't read that sentence again. This will be useful to allow composing Crux apps from smaller Crux apps to automatically wrap the child events in the parent events. We will cover this in depth in the chapter about Composable applications .

