assert_let!( TimerOperation::Start { id: second_id, millis: 1000 }, start_request.operation.clone()
);
assert_ne!(first_id, second_id); assert!(requests.next().is_none()); Now we need to tell the app that the second timer was created. let update = app .resolve(start_request, TimerOutput::Created { id: second_id }) .unwrap();
for event in update.events { app.update(event, &mut model);
} In the real world, time passes and the timer fires, but all we have to do is to resolve our start request again, but this time with a Finished response. let update = app .resolve(start_request, TimerOutput::Finished { id: second_id }) .unwrap();
for event in update.events { app.update(event, &mut model);
} Another edit should result in another timer, but not in a cancellation: let update = app.update(Event::Backspace, &mut model);
let mut requests = update.into_effects().filter_map(Effect::into_timer); assert_let!( TimerOperation::Start { id: third_id, millis: 1000 }, requests.next().unwrap().operation
);
assert!(requests.next().is_none()); // no cancellation assert_ne!(third_id, second_id); Note that this test was not about testing whether the model was updated correctly (that is covered in other tests) so we don't call the app's view() method — it's just about checking that the timer is started, cancelled and restarted correctly.

