There are only three touch-points with the core. pub fn process_event(data: &[u8]) -> Vec<u8> { todo!() }
pub fn handle_response(id: u32, data: &[u8]) -> Vec<u8> { todo!() }
pub fn view() -> Vec<u8> { todo!() } The process_event function takes a serialized Event (from a UI interaction) and returns a serialized vector of Requests that the shell can dispatch to the relevant capability's shell-side code (see the section below on how the shell handles capabilities). The handle_response function, used to return capability output back into the core, is similar to process_event except that it also takes a id, which ties the output (for example a HTTP response) being submitted with it's original Effect which started it (and the corresponding request which the core wrapped it in). The view function simply retrieves the serialized view model (to which the UI is bound) and is called by the shell after it receives a Render request. The view model is a projection of the app's state – it reflects what information the Core wants displayed on screen. You're probably thinking, "Whoa! I just see slices and vectors of bytes, where's the type safety?". Well, the answer is that we also generate all the types that pass through the bridge, for each language, along with serialization and deserialization helpers. This is done by the serde-generate crate (see the section on Create the shared types crate ). Sharp edge For now we have to manually invoke the serialization code in the shell. At some point this may be abstracted away. In this code snippet from the Counter example , notice that we call processEvent and handleResponse on the core depending on whether we received an Event from the UI or from a capability, respectively. Regardless of which core function we call, we get back a bunch of requests, which we can iterate through and do the relevant thing (the following snippet triggers a render of the UI, or makes an HTTP call, or launches a task to wait for Server Sent Events, depending on what the core requested): class Core : androidx.lifecycle.ViewModel() { var view: ViewModel? by mutableStateOf(null) private set private val httpClient = HttpClient(CIO) private val sseClient = HttpClient(CIO) { engine { endpoint { keepAliveTime = 5000 connectTimeout = 5000 connectAttempts = 5 requestTimeout = 0 } } } init { viewModelScope.launch { update(Event.StartWatch()) } } suspend fun update(event: Event) { val effects = processEvent(event.bincodeSerialize()) val requests = Requests.bincodeDeserialize(effects) for (request in requests) { processEffect(request) } } private suspend fun processEffect(request: Request) { when (val effect = request.effect) { is Effect.Render -> { this.view = ViewModel.bincodeDeserialize(view()) } is Effect.Http -> { val response = requestHttp(httpClient, effect.value) val effects = handleResponse( request.id.toUInt(), HttpResult.Ok(response).bincodeSerialize() ) val requests = Requests.bincodeDeserialize(effects) for (request in requests) { processEffect(request) } } is Effect.ServerSentEvents -> { requestSse(sseClient, effect.value) { response -> val effects = handleResponse(request.id.toUInt(), response.bincodeSerialize()) val requests = Requests.bincodeDeserialize(effects) for (request in requests) { processEffect(request) } } } } }
}

