Crux can work with any platform-specific UI library. We think it works best with modern declarative UI frameworks such as SwiftUI on iOS, Jetpack Compose on Android, and React / Vue or a Wasm based framework (like Yew ) on the web. These frameworks are all pretty much identical. If you're familiar with one, you can work out the others easily. In the examples on this page, we'll work in an Android shell with Kotlin. The components are bound to the view model, and they send events to the core. We've already seen a "hello world" example when we were setting up an Android project . Rather than print that out again here, we'll just look at how we need to enhance it to work with Kotlin coroutines. We'll probably need to do this with any real shell, because the update function that dispatches side effect requests from the core will likely need to be suspend. This is the View from the Counter example in the Crux repository. @Composable
fun View(model: Model = viewModel()) { val coroutineScope = rememberCoroutineScope() Column( horizontalAlignment = Alignment.CenterHorizontally, verticalArrangement = Arrangement.Center, modifier = Modifier .fillMaxSize() .padding(10.dp), ) { Text(text = "Crux Counter Example", fontSize = 30.sp, modifier = Modifier.padding(10.dp)) Text(text = "Rust Core, Kotlin Shell (Jetpack Compose)", modifier = Modifier.padding(10.dp)) Text(text = model.view.text, color = if(model.view.confirmed) { Color.Black } else { Color.Gray }, modifier = Modifier.padding(10.dp)) Row(horizontalArrangement = Arrangement.spacedBy(10.dp)) { Button( onClick = { coroutineScope.launch { model.update(CoreMessage.Event(Evt.Decrement())) } }, colors = ButtonDefaults.buttonColors(containerColor = Color.hsl(44F, 1F, 0.77F)) ) { Text(text = "Decrement", color = Color.DarkGray) } Button( onClick = { coroutineScope.launch { model.update(CoreMessage.Event(Evt.Increment())) } }, colors = ButtonDefaults.buttonColors( containerColor = Color.hsl(348F, 0.86F, 0.61F) ) ) { Text(text = "Increment", color = Color.White) } } }
} Notice that the first thing we do is create a CoroutineScope that is scoped to the lifetime of the View (i.e. will be destroyed when the View component is unmounted). Then we use this scope to launch asynchronous tasks to call the update method with the specific event. Button(onClick = { coroutineScope.launch { model.update(CoreMessage.Event(Evt.Increment())) } }). We can't call update directly, because it is suspend so we need to be in an asynchronous context to do so.
